    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        ## 1. Mark all negative numbers as 0
        ## 2. Mark all numbers in the range [1, len(nums)] as 1
        ## 3. Iterate through the array and mark the corresponding number as -1
