class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            output = []
            remaining = len(nums) - k
            for num in nums:
                while len(output) > 0 and remaining > 0 and output[-1] < num:
                    output.pop()
                    remaining -= 1
                if len(output) < k:
                    output.append(num)
            return output

        def merge(nums1, nums2, k):
            output = []
            i, j = 0, 0
            while len(output) < k:
                if i == len(nums1) or (j < len(nums2) and nums1[i] < nums2[j]):
                    output.append(nums1[i])
                    i += 1
                else:
                    output.append(nums2[j])
                    j += 1
            return output

        if len(nums1) > len(nums2):
            return self.maxNumber(nums2, nums1, k)

        if len(nums2) == 0:
            return [0] * k

        if k == 0:
            return []

        if k == len(nums1):
            return nums1

        if k == len(nums1) + len(nums2):
            return merge(nums1, nums2, k)

        nums1_picked = pick(nums1, k)
        nums2_picked = pick(nums2, k - len(nums1))

        return merge(nums1_picked, nums2_picked, k)

