    def checkPerfectNumber(self, num):
        """
        :type num: int
        :rtype: bool
        """

        if num == 1:
            return False

        divisors = set()
        for i in range(1, int(math.sqrt(num)) + 1):
            if num % i == 0:
                divisors.add(i)
                divisors.add(num / i)

        return sum(divisors) == num

