class Solution(object):
    def maximumGap(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        if len(nums) < 2:
            return 0

        max_num = max(nums)
        min_num = min(nums)

        if max_num == min_num:
            return 0

        gap = max(1, (max_num - min_num) // (len(nums) - 1))

        buckets = [None] * (len(nums) + 1)

        for num in nums:
            bucket_id = (num - min_num) // gap
            if buckets[bucket_id] is None:
                buckets[bucket_id] = num
            else:
                buckets[bucket_id] = min(buckets[bucket_id], num)

        prev_max = buckets[0]
        max_gap = 0

        for bucket in buckets[1:]:
            if bucket is None:
                continue
            max_gap = max(max_gap, bucket - prev_max)
            prev_max = bucket

        return max_gap

